import React, { Component } from 'react'
import { Text, View, StyleSheet,Image, TouchableHighlight, Dimensions, Platform, PixelRatio } from 'react-native'
import {
    widthPercentageToDP as wp,
    heightPercentageToDP as hp,
    listenOrientationChange as loc,
    removeOrientationListener as rol
} from 'react-native-responsive-screen';
import {TouchableOpacity} from 'react-native-gesture-handler'
import { Avatar } from 'react-native-elements';
import { FontAwesomeIcon } from '@fortawesome/react-native-fontawesome';
import { faHome,  faBars, faTimes, faCaretDown, faEdit ,faCog,faSignOutAlt} from '@fortawesome/free-solid-svg-icons';
import Menu, { MenuItem, MenuDivider } from 'react-native-material-menu';
import Icon from 'react-native-vector-icons/FontAwesome';
import * as firebase from 'firebase';
import firestore from 'firebase/firestore'
import { connect } from 'react-redux';
import { TouchableWithoutFeedback } from 'react-native-gesture-handler';
const DEFAUTL_USER  ="https://www.nehome-groupe.fr/wp-content/uploads/2015/09/image-de-profil-2.jpg"
 class HeaderMenu extends Component {

    constructor(){
        super()
        this.state = {
            isOpen : false,
            photoUri : "",
            id: "",
            size: 23,
            modifPerso: false,
            isAddNewContact: false,
            modifPersoSecond: false
        }

        this.width = Dimensions.get('window').width;
        this.height = Dimensions.get('window').height;
    }
    componentDidMount = async() =>{
        loc(this);
        const taille = this.normalize(23);
        this.setState({
            size: taille
        })
    }

    componentWillUnMount() {
        rol();
      }

    normalize(size) {
        const scale = this.width / 320;
        const newSize = size * scale 
        if (Platform.OS === 'ios') {
          return Math.round(PixelRatio.roundToNearestPixel(newSize))
        } else {
          return Math.round(PixelRatio.roundToNearestPixel(newSize)) - 2
        }
      }
    

    _menu = null;

    
    
    setMenuRef = ref => {
      this._menu = ref;
    };
   
    hideMenu = () => {
      this._menu.hide();
    };
   
    showMenu = () => {
      this._menu.show();
    };

    showProfile() {
        return(
            <View style={styles.contain_profil}>
            <View style={styles.contain_profil_1}>
            <TouchableOpacity onPress={() => this.props.navigation.navigate("Menu")} >
            <Icon
            name='chevron-left'
            size={22}
            type='font-awesome'
            color='#FFFFFF'
            style={{fontWeight: '100'}}
            />
            </TouchableOpacity>
            </View>
            <View style={styles.contain_profil_2}>
                <Text style={styles.profil_txt}>Profil</Text>
            </View>
            <View style={styles.contain_profil_3}>
                
            </View>
            </View>
        )
    }




    clickModif() {
        this.setState({modifPerso: true});
        this.props.start();
    }

    modifProfilSecondaire() {
        this.setState({modifPersoSecond: true});
        this.props.startModifSecond();
    }


    saveNewContact() {
        this.props.saveContact();
        this.props.navigation.navigate("ContactUrgence")
    }

    cancelModif() {
        this.setState({modifPerso: false});
        this.props.end();
    }

    cancelModifProfilSecondaire() {
        this.setState({modifPersoSecond: false});
        this.props.endModifSecond();
    }

    saveModif() {
        this.setState({modifPerso: false});
        this.props.save(); 
    }

    saveModifProfilSecondaire() {
        this.setState({modifPersoSecond: false});
        this.props.saveModifSecond(); 
    }

    addContactUrgence() {
        this.setState({
            isAddNewContact: true
        })
        this.props.navigation.navigate("NewContact");
    }

    backContactUrgence() {
        this.setState({
            isAddNewContact: false
        })
        this.props.navigation.navigate("ContactUrgence");
    }

    render() {
        return (
            <React.Fragment>
                <View style={styles.main_contain}>
                <View style={styles.under}>
                        {
                            (this.props.detail_vaccin && 
                                (
                                <View style={styles.container_view}>
                                    <View style={styles.arrow_back}>
                                    <TouchableOpacity onPress={() => this.props.navigation.navigate("Vaccin")}>
                                        <Icon
                                        name='chevron-left'
                                        size={22}
                                        type='font-awesome'
                                        color='#FFFFFF'
                                        style={styles.style_chevron}
                                        />
                                    </TouchableOpacity>
                                    </View>

                                    <View>
                                        <Text style={styles.profil_txt}>Mes vaccins</Text>
                                    </View>
                                </View>
                                )
                            )
                        } 
                        {
                            (this.props.vaccin && 
                                (
                                <View style={styles.container_view}>
                                    <View style={styles.arrow_back}>
                                    <TouchableOpacity onPress={() => this.props.navigation.navigate("Menu")}>
                                        <Icon
                                        name='chevron-left'
                                        size={22}
                                        type='font-awesome'
                                        color='#FFFFFF'
                                        style={styles.style_chevron}
                                        />
                                    </TouchableOpacity>
                                    </View>

                                    <View>
                                        <Text style={styles.profil_txt}>Mes vaccins</Text>
                                    </View>
                                </View>
                                )
                            )
                        }
                        {
                            (this.props.forgot && 
                                (
                                <View style={styles.container_view}>
                                    <View style={styles.arrow_back}>
                                    <TouchableOpacity onPress={() => this.props.navigation.navigate("MainSetting")}>
                                        <Icon
                                        name='chevron-left'
                                        size={22}
                                        type='font-awesome'
                                        color='#FFFFFF'
                                        style={styles.style_chevron}
                                        />
                                    </TouchableOpacity>
                                    </View>

                                    <View>
                                        <Text style={styles.profil_txt}>Modifier mot de passe</Text>
                                    </View>
                                </View>
                                )
                            )
                        }
                        {
                            (this.props.profile && 
                                (
                                <View style={styles.container_view}>
                                    <View style={styles.arrow_back}>
                                    <TouchableOpacity onPress={() => this.props.navigation.navigate("Menu")}>
                                        <Icon
                                        name='chevron-left'
                                        size={22}
                                        type='font-awesome'
                                        color='#FFFFFF'
                                        style={styles.style_chevron}
                                        />
                                    </TouchableOpacity>
                                    </View>

                                    <View>
                                        <Text style={styles.profil_txt}>Profil</Text>
                                    </View>
                                </View>
                                )
                            )
                        }
                        {
                            (this.props.urgence &&
                                (
                                <View style={{flex: 1, flexDirection: 'row', alignItems: 'center',
                                justifyContent: 'center', marginLeft: 10}}>
                                    <View style={{flex: 1, flexDirection: 'row'}}>
                                        <TouchableOpacity
                                         onPress={() => this.props.navigation.navigate("MyProfil")}>
                                        <Icon
                                        name='chevron-left'
                                        size={20}
                                        type='font-awesome'
                                        color='#FFFFFF'
                                        style={{fontWeight: '100', paddingRight: 5, paddingTop: 4}}
                                        />
                                        </TouchableOpacity>
                                        <TouchableOpacity
                                         onPress={() => this.props.navigation.navigate("MyProfil")}>
                                         <Text style={styles.modif_txt}>Profil</Text>
                                         </TouchableOpacity>
                                    </View>

                                    <View style={{flex: 2, alignItems: 'center'}}>
                                        <Text style={styles.modif_txt}>Contacts d'urgence</Text>
                                    </View>

                                    <View style={{flex: 1, alignItems: 'flex-end', paddingRight: 10}}>
                                     <TouchableOpacity onPress={() => this.addContactUrgence()}>
                                        <Text style={styles.modif_txt}>Ajouter</Text>
                                    </TouchableOpacity>
                                    </View>

                                </View>
                                )
                            )
                        }
                        {
                            (this.props.reminder &&
                                (
                                <View style={styles.contain_perso}>
                                    <View style={styles.contain_perso_1}>
                                    </View>
                                    <View style={styles.contain_perso_2}>
                                    <Text style={styles.profil_txt1}>Mes rappels</Text>
                                    </View>
                                    <View style={styles.contain_perso_3}>
                                    </View>
                                </View>
                                )
                            )
                        }
                        {
                            (this.props.ajoutEvent && 
                                (
                                <View style={styles.container_view}>
                                    <View style={styles.arrow_back}>
                                    <TouchableOpacity onPress={() => this.props.navigation.navigate("Reminder")}>
                                        <Icon
                                        name='chevron-left'
                                        size={22}
                                        type='font-awesome'
                                        color='#FFFFFF'
                                        style={styles.style_chevron}
                                        />
                                    </TouchableOpacity>
                                    </View>

                                    <View>
                                        <Text style={styles.profil_txt}>Ajout de Rappel</Text>
                                    </View>
                                </View>
                                )
                            )
                        }

                        {
                            (this.props.secondProfil &&
                                (
                                <View style={{flex: 1, flexDirection: 'row', alignItems: 'center',
                                justifyContent: 'center', marginLeft: 10}}>
                                    <View style={{flex: 1, flexDirection: 'row'}}>
                                        <TouchableOpacity
                                         onPress={() => this.props.navigation.navigate("MyProfil")}>
                                        <Icon
                                        name='chevron-left'
                                        size={20}
                                        type='font-awesome'
                                        color='#FFFFFF'
                                        style={{fontWeight: '100', paddingRight: 5, paddingTop: 4}}
                                        />
                                        </TouchableOpacity>
                                        <TouchableOpacity
                                         onPress={() => this.props.navigation.navigate("MyProfil")}>
                                         <Text style={styles.modif_txt}>Profil</Text>
                                         </TouchableOpacity>
                                    </View>

                                    <View style={{flex: 2, alignItems: 'center'}}>
                                        <Text style={styles.modif_txt}>Profils Secondaires</Text>
                                    </View>

                                    <View style={{flex: 1, alignItems: 'flex-end', paddingRight: 10}}>
                                     <TouchableOpacity onPress={() => this.props.ajouterSecondProfil()}>
                                        <Text style={styles.modif_txt}>Ajouter</Text>
                                    </TouchableOpacity>
                                    </View>

                                </View>
                                )
                            )
                        }
                        
                        {
                            (this.props.addContact &&
                                (
                                <View style={styles.contain_perso}>
                                    <View style={styles.contain_perso_1}>
                                        <TouchableOpacity onPress={() => this.backContactUrgence()} style={{flex:1, flexDirection: 'row'}}>
                                        <Icon
                                        name='chevron-left'
                                        size={22}
                                        type='font-awesome'
                                        color='#FFFFFF'
                                        style={styles.style_chevron}
                                        />
                                        <Text style={styles.txt_back_profil}>Annuler</Text>
                                        </TouchableOpacity>
                                    </View>
                                    <View style={styles.contain_perso_2}>
                                    <Text style={styles.profil_txt}>Contact</Text>
                                    </View>
                                    <View style={styles.contain_perso_3}>
                                    <TouchableOpacity onPress={() => this.saveNewContact()}>
                                        <Text style={styles.modif_txt}>Enregistrer</Text>
                                    </TouchableOpacity>
                                    </View>
                                </View>
                                )
                            )
                        }

                        {
                            (this.props.secondAdd &&
                                (
                                <View style={{flex: 1, flexDirection: 'row', alignItems: 'center',
                                justifyContent: 'center', marginLeft: 10}}>
                                    <View style={{flex: 1, flexDirection: 'row'}}>
                                        <TouchableOpacity
                                         onPress={() => this.props.navigation.navigate("MySecondProfil")}>
                                        <Icon
                                        name='chevron-left'
                                        size={20}
                                        type='font-awesome'
                                        color='#FFFFFF'
                                        style={{fontWeight: '100', paddingRight: 5, paddingTop: 4}}
                                        />
                                        </TouchableOpacity>
                                        <TouchableOpacity
                                         onPress={() => this.props.navigation.navigate("MySecondProfil")}>
                                         <Text style={styles.modif_txt}>Annuler</Text>
                                         </TouchableOpacity>
                                    </View>

                                    <View style={{flex: 2, alignItems: 'center'}}>
                                        <Text style={styles.modif_txt}>Profil Secondaire</Text>
                                    </View>

                                    <View style={{flex: 1, alignItems: 'flex-end', paddingRight: 10}}>
                                     <TouchableOpacity onPress={() => this.props.enregistrerSecondProfil()}>
                                        <Text style={styles.modif_txt}>Enregistrer</Text>
                                    </TouchableOpacity>
                                    </View>

                                </View>
                                )
                            )
                        }

                        {
                            (this.props.persoll && !this.state.modifPerso &&
                                (
                                <View style={styles.contain_perso}>
                                    <View style={styles.contain_perso_1}>
                                        <TouchableOpacity onPress={() => this.props.navigation.navigate("MyProfil")} style={{flex:1, flexDirection: 'row'}}>
                                        <Icon
                                        name='chevron-left'
                                        size={22}
                                        type='font-awesome'
                                        color='#FFFFFF'
                                        style={styles.style_chevron}
                                        />
                                        <Text style={styles.txt_back_profil}>Profil</Text>
                                        </TouchableOpacity>
                                    </View>
                                    <View style={styles.contain_perso_2}>
                                    <Text style={styles.profil_txt}>Mes Informations</Text>
                                    </View>
                                    <View style={styles.contain_perso_3}>
                                    <TouchableOpacity onPress={() => this.clickModif()}>
                                        <Text style={styles.modif_txt}>Modifier</Text>
                                    </TouchableOpacity>
                                    </View>
                                </View>
                                )
                            )
                        } 

                        {
                            (this.props.perso && !this.state.modifPerso &&
                                (
                                <View style={{flex: 1, flexDirection: 'row', alignItems: 'center',
                                justifyContent: 'center', marginLeft: 10}}>
                                    <View style={{flex: 1, flexDirection: 'row'}}>
                                        <TouchableOpacity
                                         onPress={() => this.props.navigation.navigate("MyProfil")}>
                                        <Icon
                                        name='chevron-left'
                                        size={20}
                                        type='font-awesome'
                                        color='#FFFFFF'
                                        style={{fontWeight: '100', paddingRight: 5, paddingTop: 4}}
                                        />
                                        </TouchableOpacity>
                                        <TouchableOpacity
                                         onPress={() => this.props.navigation.navigate("MyProfil")}>
                                         <Text style={styles.modif_txt}>Profil</Text>
